import { StatusBar } from 'expo-status-bar';
import React, { useState } from 'react';
import { StyleSheet, TextInput, Alert, TouchableOpacity, ToastAndroid } from 'react-native';
import ButtonGradient from '../Buttons/ButtonGradient';
import MainContainer from '../Containers/MainContainer';
import SubTitle from '../Texts/Subtitle';
import Title from '../Texts/Title';
import NormalText from '../Texts/NormalText';
import Register from '../Texts/Register';
import { useNavigation } from '@react-navigation/native';
import Svg, {SvgProps, Path, G, Defs, Pattern, Use, Image,} from "react-native-svg"
import StyledTextInputs from '../Inputs/StyledTextInputs';

function LoginScreen() {
  
  const navigation = useNavigation();

  const [inputEmail, setInputEmail] = useState('');
  const [inputPassword, setInputPassword] = useState('');
  
  function SvgTop(){
    return (
      <Svg
      width={171}
      height={150}
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
    >
      <Path fill="url(#a)" d="M0 0h171v150H0z" />
      <Defs>
        <Pattern
          id="a"
          patternContentUnits="objectBoundingBox"
          width={1}
          height={1}
        >
          <Use xlinkHref="#b" transform="scale(.0014 .00159)" />
        </Pattern>
        <Image
          id="b"
          width={715}
          height={630}
          xlinkHref="data:image/png;base64,"
        />
      </Defs>
    </Svg>
  )

  }

  return (
      <MainContainer>
      <SvgTop/>
      <Title>Hello!</Title>
      <SubTitle>Sign in with your account</SubTitle>
      <StyledTextInputs 
        placeholder = 'Email'
        value = {inputEmail}
        onChangeText = {setInputEmail}
        />         
      <StyledTextInputs 
        placeholder = 'Password' 
        value = {inputPassword} 
        onChangeText = {setInputPassword}
        secureTextEntry={true}
        />   
      <NormalText>Forgot your password?</NormalText>
      <ButtonGradient onPress = {() => {
        fetch(('http://192.168.15.253:3002/user/' + inputEmail + '/' + inputPassword), {
            method: 'GET',
            headers: {
                Accept: 'application/json',
                'Content-Type': 'application/json',
            },
        }).then((response) => response.json())
          .then((data) => {
            if (data.error === "ERROR_GET_USER"){
              Alert.alert(
                'ALERT!',
                'Error logging in...',
                [{ text: 'OK', onPress: () => console.log('OK Pressed') }],
                { cancelable: false }
                );
            }else{
              ToastAndroid.showWithGravityAndOffset(
                'Successful login',
                ToastAndroid.LONG,
                ToastAndroid.BOTTOM,
                25,
                50,
              );
            navigation.navigate('Home' as never);
            };
          })
          .catch ((error) => {
            console.log(error);
              Alert.alert(
                'ALERT!',
                'Error logging in...',
                [{ text: 'OK', onPress: () => console.log('OK Pressed') }],
                { cancelable: false }
            );
          });
        }}/>
      <NormalText>Don't have an account?</NormalText>
      <TouchableOpacity onPress={() => navigation.navigate('Register' as never)}>
        <Register>Sign Up!</Register>
      </TouchableOpacity>
      <StatusBar style="auto" /> 
    </MainContainer>
  )
}

export default LoginScreen;

